import React, { Component } from "react";
import "./featured.css";

class Featured extends Component {
  state = {};
  render() {
    return (
      <div
        className="featured"
        style={{
          height: `${window.innerHeight}px`,
          background: `${this.props.background}`
        }}
      >
        <div className="container">{this.props.children}</div>
      </div>
    );
  }
}

export default Featured;

